import React from "react";
import ItemList from "./ItemList";

const Items = ({ food, onSelect }) => {
   const SetCount = (count) => {
      console.log(count);
      onSelect(count);
   };

   return (
      <div className="container bg-white mx-auto mt-4 rounded">
         {food.map((item) => (
            <ItemList
               key={item.id}
               name={item.name}
               price={item.price}
               desc={item.desc}
               onSelect={SetCount}
            />
         ))}
      </div>
   );
};

export default Items;
